INSERT INTO `wp_posts` VALUES (1,1,'2023-01-13 19:05:21','2023-01-13 19:05:21','<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->','Hello world!','','publish','open','open','','hello-world','','','2023-01-13 19:05:21','2023-01-13 19:05:21','',0,'http://142.93.255.16/?p=1',0,'post','',0),(2,1,'2023-01-13 19:05:21','2023-01-13 19:05:21','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://142.93.255.16/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','trash','closed','open','','sample-page__trashed','','','2023-01-13 19:31:14','2023-01-13 19:31:14','',0,'http://142.93.255.16/?page_id=2',0,'page','',0),(3,1,'2023-01-13 19:05:21','2023-01-13 19:05:21','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://142.93.255.16.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where your data is sent</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2023-01-13 19:05:21','2023-01-13 19:05:21','',0,'http://142.93.255.16/?page_id=3',0,'page','',0),(4,1,'2023-01-13 19:05:50','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2023-01-13 19:05:50','0000-00-00 00:00:00','',0,'http://142.93.255.16/?p=4',0,'post','',0),(5,1,'2023-01-13 19:19:20','2023-01-13 19:19:20','<!-- wp:heading -->\n<h2>Alma Peterson, REALTOR</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Whether you\'re a first time home-buyer, looking for your next home, or looking to sell your current home, I am here to help you!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>After selling 77 homes in the last 18 months, I\'ll use my 10 years of successful experience in real estate to make buying or selling your home a breeze.</p>\n<!-- /wp:paragraph -->','Home','','publish','closed','closed','','home','','','2023-01-13 23:21:41','2023-01-13 23:21:41','',0,'http://142.93.255.16/?page_id=5',0,'page','',0),(6,1,'2023-01-13 19:19:20','2023-01-13 19:19:20','','Home','','inherit','closed','closed','','5-revision-v1','','','2023-01-13 19:19:20','2023-01-13 19:19:20','',5,'http://142.93.255.16/?p=6',0,'revision','',0),(7,1,'2023-01-13 19:30:03','2023-01-13 19:30:03','','Typical private home at an affluent residential area on Marco Is','Typical private home at an affluent residential area on Marco Island, Florida.','inherit','open','closed','','typical-private-home-at-an-affluent-residential-area-on-marco-is','','','2023-01-13 19:30:03','2023-01-13 19:30:03','',5,'http://142.93.255.16/wp-content/uploads/2023/01/AdobeStock_360765911.jpeg',0,'attachment','image/jpeg',0),(8,1,'2023-01-13 19:30:59','2023-01-13 19:30:59','{\n    \"remania::enable_header_search\": {\n        \"value\": false,\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2023-01-13 19:30:59\"\n    },\n    \"remania::show_author_bio\": {\n        \"value\": false,\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2023-01-13 19:30:59\"\n    }\n}','','','trash','closed','closed','','95b162e6-38d9-4498-b417-d1777c5f72d0','','','2023-01-13 19:30:59','2023-01-13 19:30:59','',0,'http://142.93.255.16/2023/01/13/95b162e6-38d9-4498-b417-d1777c5f72d0/',0,'customize_changeset','',0),(9,1,'2023-01-13 19:31:14','2023-01-13 19:31:14','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi the